#按下面的说明编写一个程序，模拟网站确保每位用户的用户名都独一无二的方式。·创建一个至少包含5个用户名的列表，并将其命名为current_users。·再创建一个包含5个用户名的列表，将其命名为new_users，并确保其中有一两个用户名也包含在列表current_users中。·遍历列表new_users，对于其中的每个用户名，都检查它是否已被使用。如果是这样，就打印一条消息，指出需要输入别的用户名；否则，打印一条消息，指出这个用户名未被使用。·确保比较时不区分大小写；换句话说，如果用户名'John'已被使用，应拒绝用户名'JOHN'。5-11 序数：序数表示位置，如1st和2nd。大多数序数都以th结尾，只有1、2和3例外。·在一个列表中存储数字1～9。·遍历这个列表。·在循环中使用一个if-elif-else结构，以打印每个数字对应的序数。输出内容应为1st、2nd、3rd、4th、5th、6th、7th、8th和9th，但每个序数都独占一行。
